script: |
  super -f text -I q5528.spq | sort > q5528.out

inputs:
  - name: q5528.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE - + col1 NOT BETWEEN + col0 AND CAST ( + ( + + ( - - col1 ) ) AS INTEGER );
  - name: tab1

outputs:
  - name: q5528.out
    data: |
      51	14	96
      85	5	59
      91	47	68
